export default function Member({member}){
    
    return(
        <li>
            <h3>{member.name}</h3>
            <img src={member.image} alt={member.image}></img>
            <p className="pWeight">{"weight: " + member.weight}</p>
            <p className="pcR">{"CalorieRecord: " + member.calorieRecord}</p>
            <button className="button">Select</button>
        </li>
    )
}
